function GetEpisode(ShowID){
    fetch(`https://api.spreaker.com/v2/shows/` +
                        ShowID +
                        `/episodes`
    )
    .then((response)=>response.json())	
    .then((episodes) => {
        setPodcast(episodes.response)
        return episodes;
    })
}
